import React from 'react'

function Dashboard() {
  return (
    <div className="dashboard">
      <div className="headContainer">
        <h1>Medical Laboratory</h1>
        <p>Behind every great Doctor, there's a great Medical Technologist</p>
      </div>
    </div>
  )
}

export default Dashboard
